python3 << 'EOF'
import json
import re

with open('/Users/imorgado/Desktop/FACEIQCOPY/FACEIQPAID/site-capture-beta.faceiqlabs.com-1766244328972.json', 'r') as f:
    data = json.load(f)

# Extract all usedLandmarks from ratios to build landmark index
landmarks_used = {}
for call in data.get('apiCalls', []):
    if call.get('url') == '/api/faces/cmjeg1nfr31782wfqyh6aab4w' and call.get('method') == 'GET':
        body = call.get('response', {}).get('body', {})
        if isinstance(body, dict) and 'face' in body:
            face = body['face']
            if 'harmonyAnalysis' in face:
                # Process both front and side
                for profile in ['front', 'side']:
                    if profile in face['harmonyAnalysis']:
                        prof_data = face['harmonyAnalysis'][profile]
                        if 'ratios' in prof_data:
                            for ratio in prof_data['ratios']:
                                if 'usedLandmarks' in ratio:
                                    lms = ratio['usedLandmarks']
                                    for lm in lms:
                                        if lm not in landmarks_used:
                                            landmarks_used[lm] = {'count': 0, 'profiles': []}
                                        landmarks_used[lm]['count'] += 1
                                        if profile not in landmarks_used[lm]['profiles']:
                                            landmarks_used[lm]['profiles'].append(profile)

print("=== All Unique Landmarks Used in Analysis ===\n")
for lm in sorted(landmarks_used.keys()):
    info = landmarks_used[lm]
    profiles = ','.join(info['profiles'])
    print(f"{lm:40s} | Used in: {profiles:15s} | Count: {info['count']}")

